import { useState }from "react";

const jsonData =[{
  key:"1",
  name:"michi",
},{
  key:"2",
  name:"Max",
},{
  key:"8",
  name:"Alfonso"
}];


const App = () => {

    return(
      <div>
        {
          jsonData.map((value, index)=>{
            return (
              <div key={index}>
                  <p>{value.name}</p>
              </div>
            );

          })}

      </div>
    );
}

export default App;
